window.bookSummaryJSON = "<p><b>She’s getting a fake boyfriend - me. </b><br> <b>Whether she likes it or not.</b><br> The leggy car thief is trouble with a capital T. <br> My brother went down because of her <br> I need to find him before the cops do, <br> which means I’m not letting her out of my sight. <br> Anywhere the human goes, I go. <br> I’ll play her fake boyfriend. <br> Sleep in her bedroom. <br> Go to her prep school classes. <br> Take her to the homecoming dance. <br> I will learn all her secrets, find out all her games. <br> By the time I’m done with her, she’ll be sorry. <br> Sorry she ever set foot in our shop. <br> Sorry she ever met me. <br> Sorry she made me fall for her.</p>"; 
